function Header() {
    return (
        <header className="hero is-dark is-bold">
        <div className="hero-body">
          <div className="container">
            <h1 className="title">Craft Werks</h1>
          </div>
        </div>
      </header>
    );
}

function App() {
    return (
        <div>
            <Header />
            <p>Hello world!!</p>
        </div>
    );
}

export default App;
